import React, { Fragment, useState } from 'react';
import Button from 'react-bootstrap/Button';
import Offcanvas from 'react-bootstrap/Offcanvas';

import t1 from '../components/assets/t1.png'
import t2 from '../components/assets/t2.png'
import t3 from '../components/assets/t3.png'

function Example() {
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <Fragment>
        <div>
    <div>
      <Button variant="primary" onClick={handleShow} style = {{color: 'red'}}>
        Launch
      </Button>

      <Offcanvas show={show} onHide={handleClose}>
        <Offcanvas.Header closeButton>
          <Offcanvas.Title>Offcanvas</Offcanvas.Title>
        </Offcanvas.Header>
        <Offcanvas.Body>
          Some text as placeholder. In real life you can have the elements you
          have chosen. Like, text, images, lists, etc.
        </Offcanvas.Body>
      </Offcanvas>
      </div>

      {/* <div style={{display: 'flex', justifyContent: 'space-around', flexWrap: 'wrap'}}> */}
      <div>
      {/* <h4>Kartat qe do i ve me img super bukur</h4> */}
      <h5>
      <img src={t2} style={{width: '250px', height: '250px'}} alt='avokate'></img>
      </h5>
      {/* <h5>
        <img src={t1} style={{width: '250px', height: '250px'}} alt='avokate'></img>
        </h5>
      <img src={t3} style={{width: '250px', height: '250px'}} alt='avokate'></img> */}
    </div>
    </div>
    </Fragment>
  );
}

export default Example;
